import './App.css';

const App = () =>
{
  return (

      <div className="app-wrapper">
          <header>
              <img src="https://pbs.twimg.com/profile_banners/966174940990005248/1532972097/1500x500" alt=""/>
          </header>
          <nav>
              Профиль
          </nav>
          <nav>
              Сообщения
          </nav>
          <nav>
              Main content
          </nav>
      </div>
  )
}

export default App;
